import groovy.json.JsonSlurper
import java.io.*;
//获取response值，注testSteps指得是请求名称，而不是TestCase的名称
        def xresponse = testRunner.testCase.testSteps["ReportListAll"].testRequest.response.contentAsString
        def slurper = new JsonSlurper()
        def result = slurper.parseText(xresponse)
        log.info("返回邀请列表 ："+result)
        //获取json串中msg值
        def msg=result.data.toString()
        def msg2=result.msg.toString()
        log.info("返回json字符串结果 ： "+msg)
         log.info("返回msg： "+msg2)
        //断言
          assert msg2.equals("ok")
          def num = result.data.reports.size()
          log.info("返回数据 ："+num)  
          def total =result.data.total.toString()
        if(msg2== "ok" && total !="0")
        {
                  //获取json串中id和orderSyncId值

                  def serviceId =result.data.reports.serviceId.toString()
                  if(serviceId !=null & serviceId  !=" ")
                  {                     
                          //将订单ID存入testCase中CustomProperty的参数
                         testRunner.testCase.setPropertyValue("serviceId",serviceId)
                           log.info("获取sessionToken信息成功！")  
                            log.info("医生serviceID："+serviceId)
                            return serviceId                        
                  }else
                  {
                         log.info("获取医生id失败！")
                  }                 
        }else
        {
                  log.info("获取所有信息失败，请检查！")
        }

